import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './login.js';
import AdminDashboard from './pages/AdminDashboard.js';
import UserDashboard from './pages/UserDashboard.js'; 
import UsersPage from './pages/UsersPage.js';
import Dashboard from './pages/Dashboard.js';
import Accueil from './pages/Accueil.js';  // corrigé, dans dossier pages
import SearchHotels from './pages/SearchHotels.js';  // ta page recherche hôtels

import Main from './pages/Main.js';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />

        {/* Routes admin */}
        <Route path="/admin" element={<AdminDashboard />}>
          <Route index element={<Dashboard />} />
          <Route path="users" element={<UsersPage />} />
          <Route path="userdashboard" element={<UserDashboard />} />
        </Route>

        {/* Routes user */}
        <Route path="/user" element={<Main />}>
          <Route index element={<Accueil />} />  {/* page par défaut */}
          <Route path="search" element={<SearchHotels />} />  {/* ajout recherche hôtels */}
          {/* autres sous-pages ici */}
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
